import React from 'react';

const HomePage = () => (
    <div className="homepage">
        <div className="directory-menu">
            <div className="menu-item">
                <div className="contenter">
                    <div className="title">
                        <h1>Hat</h1>
                        <h2>Men</h2>
                    </div>
                </div>
            </div>
        </div>
    </div>
);
export default HomePage;
